import React, {Component} from 'react';
import CardList from './CardList';
import {robots} from './robots'
import SearchBox from './SearchBox';

const App = () => {
	return (
		<div className="tc f1">
		<h1>Robo Friends</h1>	
		<SearchBox/>
		<CardList robots={robots}/>
		</div>
	);
}

export default App;
